Le Partenariat pour la paix (PPP) est une structure d'association libre bilatérale entre un État et l'Organisation du traité de l'Atlantique nord (OTAN), servant à impliquer dans une démarche commune de coopération militaire pacifique des pays ne souhaitant pas pour autant faire partie de l'OTAN.


== Document cadre ==
Le document cadre contient notamment les buts suivants :

« développer des relations militaires de coopération avec l'OTAN » ;
« se doter, à plus long terme, de forces plus en mesure d'opérer avec celles des membres de l'Alliance de l'Atlantique Nord » ;
« mettre au point avec les autres États qui souscrivent au présent document un processus de planification et d'examen qui servira à déterminer et à évaluer les forces et les moyens que ces autres États pourraient mettre à disposition pour des activités de formation, des exercices et des opérations à caractère multinational menés de concert avec des forces de l'Alliance ».

En français le terme Albanais désigne :

selon la Constitution de l'Albanie, le droit du sol et le droit international, les citoyens de l’Albanie et eux seuls, quelles que soient leurs langues, origines et traditions culturelles ;
selon la définition ethnique, le droit du sang et l'appartenance linguistique et culturelle, le groupe ethnique indo-européen qui s’auto-désigne en albanais Shqiptarët, et qui vit majoritairement en Albanie et au Kosovo, mais aussi à l’ouest de la Macédoine du Nord, au sud de la Serbie et du Monténégro, ainsi qu’en Grèce.

En français, le mot Serbes peut désigner :

sur le plan politique, l’ensemble des citoyens de la Serbie, quelles que soient leurs origines, langues et cultures ;
sur le plan culturel et linguistique, les Serbes (en serbe « Срби », « Srbi ») sont une ethnie ou une nation de la branche des Slaves méridionaux, du groupe Slave et de la famille indo-européenne, qui vit essentiellement en Serbie, au Monténégro, en Bosnie-Herzégovine, en Croatie et dans une diaspora de quatre millions de personnes (un Serbe sur trois ne vit pas en Serbie) ;
sur le plan historique :
dans l'histoire, des peuples Slaves comme les Sorabes (voir Serbie blanche) et les Slaves méridionaux;
dans les hypothèses protochronistes très en vogue en Serbie moderne, parmi les Sarmates iraniens vivant dans l'Antiquité entre la Basse-Volga et le Caucase du Nord et décrits par Pline l'Ancien et par Claude Ptolémée dans sa Géographie du IIe siècle apr.

